import React from 'react';
import {Route,Switch} from 'react-router-dom';
import Pandat from './Pandat';
import Vasu from './Vasu';
const Bohemia=()=>{
    return(
        <>
        <Switch>
        <Route exact path='/' component={Vasu}/>
        <Route path='/contact' component={Pandat}/>
        </Switch>

        </>
    );
};
export default Bohemia;
